const {ethers} = require('ethers');

async function main() {
  const p = new ethers.JsonRpcProvider(process.env.BASE_RPC || 'https://mainnet.base.org');
  const w = new ethers.Wallet(process.env.DAIMON_WALLET_KEY, p);

  // Step 1: Get validation token from Venice API
  const response = await fetch('https://api.venice.ai/api/v1/api_keys/generate_web3_key');
  const data = await response.json();

  if (!data.data || !data.data.token) {
    console.error('Failed to get token:', data);
    process.exit(1);
  }

  const token = data.data.token;
  console.log('Got validation token:', token.substring(0, 50) + '...');

  // Step 2: Sign the token with wallet
  const signature = await w.signMessage(token);
  console.log('Signed token:', signature.substring(0, 50) + '...');

  // Step 3: Generate API key
  const keyResponse = await fetch('https://api.venice.ai/api/v1/api_keys/generate_web3_key', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({
      description: 'Daimon Agent API Key',
      apiKeyType: 'INFERENCE',
      signature: signature,
      token: token,
      address: w.address,
      consumptionLimit: { diem: 2 }
    })
  });

  const keyData = await keyResponse.json();
  console.log('API Key Response:', JSON.stringify(keyData, null, 2));
}

main().catch(console.error);
""}

